import {FaShoppingCart} from "react-icons/fa"

const Navbar = () => {
  return (
    <div>
       <div className="flex flex-row justify-between">
          <img src="https://www.google.com/imgres?q=codehelp%20logo&imgurl=https%3A%2F%2Ft3.ftcdn.net%2Fjpg%2F03%2F99%2F53%2F44%2F360_F_399534445_zG1tMcAn0q7bCaPw2Lp5ZWiBiBgQYxvN.jpg&imgrefurl=https%3A%2F%2Fstock.adobe.com%2Fsearch%3Fk%3Dcode%2Blogo&docid=Uf8-gOwvB0yFHM&tbnid=ScYEhdHo1A1JpM&vet=12ahUKEwiUsqrmquSFAxXzUfUHHXOpCcUQM3oFCIABEAA..i&w=600&h=360&hcb=2&ved=2ahUKEwiUsqrmquSFAxXzUfUHHXOpCcUQM3oFCIABEAA"/>
          <div>
            <p>home</p>
            <FaShoppingCart/>
          </div>
       </div>
    </div>
  );
};



export default Navbar;
